        size:"grande",
        impresion:"sublimado"
    },
    {
        src:Bottle5,
        type:"Este portabotellas",
        size:"grande",
        impresion:"sublimado"
    },
    {
        src:Bottle6,
        type:"Este portabotellas",
        size:"grande",
        impresion:"sublimado"
    },
];

export default bottleHolders;
